import React from 'react';
import Sidebar from './Sidebar';
import SidebarRight from './SidebarRight';
import Homediv from './Homediv';
import Header from './Header';   

function App(){
    return (
        <div>   
        <div>

        </div>     
        <div>
            <Sidebar />
            <SidebarRight />
            
            <Homediv cname="hdiv1" cont="Home"/>
            <Homediv cname="hdiv2" cont="Materials"/>
            <Homediv cname="hdiv1" cont="Courses"/>
            <Homediv cname="hdiv2" cont="Softwares"/>
            <Homediv cname="hdiv1" cont="Internships"/>
            <Homediv cname="hdiv2" cont="Career"/>
            </div>
        </div>);
}

export default App;
 // color2 : #5E8B7E
